import React,{useState,useEffect} from 'react'
import Fetch from './Fetch'
import './Data.css'

function Data() {


const [data,setdata]=useState([])


useEffect(()=>{
    fetchdata()
},[])


async function fetchdata()
{
    await Fetch.getdata().then(res=>{
        setdata(res)
    })
    .catch((err)=>{console.log(err)})
}

  return (
    <div className='data'>
    
        <table>
            <th>Name</th>
            <th>Rank</th>
            <th>Country</th>
            {
                data?data.map((val)=>(
                    <tr>
                        <td>{val.name}</td>
                        <td>{val.ranking}</td>
                        <td>{val.country}</td>
                    </tr>
                )):<></>
            }
        </table>
    </div>
  )
}

export default Data
